-bottom: 10px; color: #004080;\\\">نوع المنتج</h3>\\n<p style=\\\"font-size: 18px;\\\">رغوة تنظيف عالمية متعددة الاستخدامات – مناسبة للاستخدام على الأجهزة الإلكترونية والأسطح المنزلية المختلفة</p>\\n</div>\\n<p><!-- السعة --></p>\\n<div style=\\\"background-color: #fefefe; padding: 25px; margin-bottom: 20px; border-radius: 12px; border: 1px solid #ddd;\\\">\\n<h3 style=\\\"font-size: 20px; font-weight: bold; margin-bottom: 10px; color: #333;\\\">السعة</h3>\\n<p style=\\\"font-size: 18px;\\\">550 مل (7.2 أونصة سائلة) – عبوة كافية للاستخدام المتكرر</p>\\n</div>\\n<p><!-- المميزات --></p>\\n<div style=\\\"background-color: #e6f0fa; padding: 25px; margin-bottom: 20px; border-radius: 12px; border: 1px solid #cbddee;\\\">\\n<h3 style=\\\"font-size: 20px; font-weight: bold; margin-bottom: 10px; color: #004080;\\\">المميزات</h3>\\n<ul style=\\\"font-size: 18px; padding-left: 20px; margin: 0;\\\">\\n<li>مبادرة خضراء – صديق للبيئة</li>\\n<li>إزالة الروائح – يزيل الروائح الكريهة</li>\\n<li>فرشاة مدمجة – سهولة في الاستخدام</li>\\n<li>مناسب للأجهزة الإلكترونية – آمن على الشاشات والكمبيوترات</li>\\n<li>مناسب للأسطح المنزلية – الأثاث والجدران</li>\\n</ul>\\n</div>\\n<p><!-- الاستخدامات --></p>\\n<div style=\\\"background-color: #f6fff5; padding: 25px; margin-bottom: 20px; border-radius: 12px; border: 1px solid #cde8cd;\\\">\\n<h3 style=\\\"font-size: 20px; font-weight: bold; margin-bottom: 10px; color: #2e7d32;\\\">الاستخدامات</h3>\\n<ul style=\\\"font-size: 18px; padding-left: 20px; margin: 0;\\\">\\n<li>تنظيف شاشات الكمبيوتر والتلفزيون</li>\\n<li>تنظيف أجهزة الكمبيوتر المكتبية والمحمولة</li>\\n<li>تنظيف الأثاث والجدران</li>\\n<li>إزالة الأتربة والأوساخ من الأسطح المختلفة</li>\\n<li>تنظيف الأجهزة الإلكترونية بأمان</li>\\n</ul>\\n</div>\\n<p><!-- طريقة الاستخدام --></p>\\n<div style=\\\"background-color: #fefefe; padding: 25px; margin-bottom: 20px; border-radius: 12px; border: 1px solid #ddd;\\\">\\n<h3 style=\\\"font-size: 20px; font-weight: bold; margin-bottom: 10px; color: #333;\\\">طريقة الاستخدام</h3>\\n<p style=\\\"font-size: 18px;\\\">1. رج العبوة جيداً قبل الاستخدام<br />\\n2. اضغط على الفوهة لرش الرغوة على السطح<br />\\n3. استخدم الفرشاة المدمجة أو قطعة قماش ناعمة لفرك السطح<br />\\n4. امسح السطح بقطعة قماش جافة ونظيفة</p>\\n</div>\\n<p><!-- الأمان --></p>\\n<div style=\\\"background-color: #fff5e6; padding: 25px; margin-bottom: 20px; border-radius: 12px; border: 1px solid #ffd699;\\\">\\n<h3 style=\\\"font-size: 20px; font-weight: bold; margin-bottom: 10px; color: #cc6600;\\\">الأمان</h3>\\n<p style=\\\"font-size: 18px;\\\">آمن للاستخدام على الأجهزة الإلكترونية الحساسة – لا يترك بقايا – مناسب للأسطح المختلفة</p>\\n</div>\\n\", \"has_options\": false, \"purchasable\": true, \"related_ids\": [13079, 13075, 13068], \"total_sales\": 0, \"date_created\": \"2025-12-09T18:44:58\", \"downloadable\": false, \"external_url\": \"\", \"manage_stock\": false, \"rating_count\": 0, \"stock_status\": \"instock\", \"date_modified\": \"2025-12-09T18:56:44\", \"post_password\": \"\", \"purchase_note\": \"\", \"regular_price\": \"100\", \"average_rating\": \"0.00\", \"cross_sell_ids\": [], \"download_limit\": -1, \"shipping_class\": \"\", \"stock_quantity\": null, \"date_on_sale_to\": null, \"download_expiry\": -1, \"reviews_allowed\": false, \"date_created_gmt\": \"2025-12-09T18:44:58\", \"global_unique_id\": \"\", \"grouped_products\": [], \"low_stock_amount\": null, \"shipping_taxable\": true, \"date_modified_gmt\": \"2025-12-09T18:56:44\", \"date_on_sale_from\": null, \"shipping_class_id\": 0, \"shipping_required\": true, \"short_description\": \"<div style=\\\"padding: 25px; margin-bottom: 25px; border-radius: 10px;\\\">\\n<p style=\\\"font-size: 18px; color: #000; line-height: 1.6;\\\">فوم تنظيف مخصص للأجهزة الإلكترونية، آمن على شاشة اللابتوب والكيبورد والسطح الخارجي. بيشيل الأتربة والبقع وآثار الإيد من غير ما يسيب خطوط أو يأثر على المكونات. استخدامه المنتظم بيساعد يحافظ على شكل اللابتوب وأداؤه لفترة أطول.</p>\\n</div>\\n\", \"sold_individually\